Step-by-step reasoning:

1. Key psychological mechanism:
 • Responder’s evaluation is guided by a fairness reference computed from the participant’s token contribution relative to the total (i.e., r = combined_earning × (token_self/(token_self+token_opp))). Offers at or near this “fair share” are evaluated neutrally, whereas offers that deviate (either too low or above the reference) are perceived in a non‐linear fashion. In our formulation, deviations from this fairness benchmark are “amplified” or “attenuated” by a non-linear transformation of the offered share.
 
2. How these mechanisms interact:
 • The observed split_self is “distorted” by comparing it to the fairness reference r. This distortion is implemented as a multiplicative factor that is a power transformation of the ratio (split_self/r). Thus, if the offered share is lower than the fairness benchmark the ratio is below one and the power transformation further diminishes the perceived value. Conversely, if the offered share is higher than the benchmark, the ratio exceeds one and the transformation boosts the perceived benefit. An additive baseline utility (mu) accounts for any independent bias in acceptance.
 
3. Mathematical form:
 • We define the fairness benchmark r = combined_earning × (token_self/(token_self+token_opp)).
 • Then the utility U (for accepting an offer) is defined as the baseline plus a non-linear transformation of the offered share:
   U = mu + split_self × (split_self/r)^(lambda_param)
 • Here, lambda_param controls how strongly deviations from fairness are weighted. When lambda_param = 0 the multiplication factor is 1 and utility equals mu plus the raw offered share; for lambda_param > 0, offers below fairness yield a lower effective value, while offers above fairness get an extra boost.
 
4. Learnable parameters:
 • mu: An additive baseline bias.
 • lambda_param: A fairness-sensitivity (non-linearity) parameter.
 We constrain mu and lambda_param within generous but finite bounds (e.g., mu ∈ [–100, 100] and lambda_param ∈ [0, 10]).
 
5. Mapping to observable behavior:
 • The observed variables split_self, combined_earning, token_self, and token_opp directly compute the fairness benchmark r and the transformed value of the offer.
 • The computed utility U is then used (with an externally added temperature parameter) to predict the probability that a responder accepts the offer.

