def simulate_model(trial_data, mu=0, lambda_param=1):
    utility_values = []
    for trial in trial_data:
        try:
            combined_earning = trial['combined_earning']
            token_self = trial['token_self']
            token_opp = trial['token_opp']
            split_self = trial['split_self']

            r = combined_earning * (token_self / (token_self + token_opp))
            if r ==0:
                utility = float('-inf')
            else:
                utility = mu + split_self * (split_self / r) ** lambda_param

            utility_values.append(utility)
        except (KeyError, ZeroDivisionError):
             #Handle missing keys or division by zero appropriately.  Here, we'll append a NaN value.
            utility_values.append(float('nan'))
    return utility_values
